import logo from './logo.svg';
import './App.css';
import {
  BrowserRouter,
  Routes,
  Route,
  Link
} from "react-router-dom";
import Main from './EX9/Q1/Main';
function App() {
  return (
    <div className="App">


      <BrowserRouter>

        <Routes>
          <Route path="/:id" element={<Main />} />

        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
